import React from "react";

const Home = () => {
    return(
        <div style={{display:'flex', flexDirection:'column', justifyContent:'center', alignItems:'center', backgroundSize:'cover', height:'100vh'}}>
            <p style={{ fontSize:'60px'}}>Welcome</p>
            <span style={{ fontSize:'36px',}}>Digital Portfolio Project Search</span>
            <span>This website contains each of my project's deployments or demonstrations.</span>
            <span>Visit the links above to view my projects.</span>
        </div>
    );
} 
export default Home;
